"""verify is bouncing score a remotely good idea"""
import random
import multiprocessing

import matplotlib.pyplot as plt

from genetic import solve_gen1, make_labyrinth, decode_moves


def compute(l, bounce):
    debug_box = {}

    _ = solve_gen1(l, bouncing=bounce, debug=debug_box)

    bounces = debug_box["bounces"]
    f = debug_box["ga"].best_individual()[0]

    if bounce:
        best_distance = f[0]
    else:
        best_distance = f[0]

    return (bounces, best_distance)

