    def make_plot(points, label):
        from collections import Counter
        counted_points = Counter(points)
        y, x = zip(*counted_points.keys())
        print(f"sum of distance per sample for {label} (less is better)", sum(x) / 1000)
        s = [x ** 2 for x in  counted_points.values()]

        plt.style.use('seaborn-whitegrid')
        return plt.scatter(x, y, s=s, label=label)

